import NavBar from './components/NavBar';
import SideBar from './components/SideBar';
import PhoneticsList from './components/PhoneticsList';
function App() {
  return (
    <div className="App">
        <SideBar/>
        <div id="content">
          <NavBar/>
          <Switch>
            <Route exact path="/">
              <PhoneticsList/>
            </Route>
            <Route exact path="/examples/:name">
              <ExampleOfPhonetic/>
            </Route>
          </Switch>

        </div>
    </div>
  );
}

export default App;
